import './CartItem.css';

const CartItem = () => {
  return (
    <div className="cartitem">
      <div className="cartitem__left">
        <h2>left</h2>
      </div>
      <div className="cartitem__right">
        <h2>right</h2>
      </div>
    </div>
  );
}

export default CartItem;
